import React from "react";

const Navbar = ({ filterItem, Menulist }) => {
  return (
    <>
      <nav className="navbar">
        <div className="btn-group">
          {Menulist.map(() => {
            return (
              <button
                className="btn-group__item"
                onClick={() => filterItem("breakfast")}
              >
                Breakfast
              </button>
            );
          })}

        </div>
      </nav>
    </>
  );
};

export default Navbar;
